text:
Nunca fui tão fã de um povo como tenho sido do povo do nordeste. 

- Não votaram no Bozo;
- Anos sofrendo com seca e negligência do governo; 
- Agora estão arriscando a própria saúde pra retirar o óleo das praias;

Um dia o Brasil ainda vai merecer vocês. 

Nos desculpem.

Pará o bem da sua saúde mental:

• não espere aquela mensagem chegar;
• não compare a sua vida com a de ninguém;
• evite stalkear quem não te merece;
• se beber não manda mensagem.
